from collections import defaultdict
from typing import * 
from bisect import bisect_left, bisect_right

class MajorityChecker:

    def between_count(self,pos_freq: tuple, left: int, right: int, threshold)->int:
        pos = pos_freq[0]
        # the exact match position will be included in the slice
        leftSlicePos = bisect_left(pos, left)

        # the exact match position will be excluded from the slice
        rightSlicePos = bisect_right(pos, right)
        return pos_freq[1] if len(pos[leftSlicePos:rightSlicePos]) >= threshold else None


    def __init__(self, arr: List[int]):
        self.arr = arr
        d = defaultdict(lambda:[])
        for i in range(len(arr)):
            d[arr[i]].append(i)
        
        self.pos_store = set()
        for (k,v) in d.items():
            self.pos_store.add((tuple(v),k))            

    def __repr__(self):
        return repr(self.pos_store)
    
            
    def query(self, left: int, right: int, threshold: int) -> int:
        eligible_nums = set(self.arr[left:right+1])    
        eligble_store = filter(lambda p:p[1] in eligible_nums,self.pos_store )
        return next(filter(lambda p:self.between_count(p, left, right, threshold),eligble_store),[None, -1])[1]
            





        



